In async Rust, it is common to implement cancellation and timeouts by dropping a future after a certain period of time instead of polling it to completion. This is how tokio::time::timeout works, for example. However, doing this with futures returned by the driver can leave the driver's internals in an inconsistent state, which may lead to unpredictable or incorrect behavior (see RUST-937 for more details). As such, it is highly recommended to poll all futures returned from the driver to completion. In order to still use timeout mechanisms like tokio::time::timeout with the driver, one option is to spawn tasks and time out on their JoinHandle futures instead of on the driver's futures directly. This will ensure the driver's futures will always be completely polled while also allowing the application to continue in the event of a timeout. e.g. # extern crate mongodb;
# extern crate tokio;
# use std::time::Duration;
# use mongodb::{
# Client,
# bson::doc,
# };
#
# async fn foo() -> std::result::Result<(), Box<dyn std::error::Error>> {
#
# let client = Client::with_uri_str("mongodb://example.com").await?;
let collection = client.database("foo").collection("bar");
let handle = tokio::task::spawn(async move { collection.insert_one(doc! { "x": 1 }, None).await
}); tokio::time::timeout(Duration::from_secs(5), handle).await???;
# Ok(())
# }

