A Client should be as long-lived as possible. Establishing a new Client is relatively slow and resource-intensive, so ideally that should only be done once at application startup. Because Client is implemented using an internal Arc , it can safely be shared across threads or tasks, and cloneing it to pass to new contexts is extremely cheap. # extern crate mongodb;
# use mongodb::Client;
# use std::error::Error;
// This will be very slow because it's constructing and tearing down a `Client`
// with every request.
async fn handle_request_bad() -> Result<(), Box<dyn Error>> { let client = Client::with_uri_str("mongodb://example.com").await?; // Do something with the client Ok(())
} // This will be much faster.
async fn handle_request_good(client: &Client) -> Result<(), Box<dyn Error>> { // Do something with the client Ok(())
} This is especially noticeable when using a framework that provides connection pooling; because Client does its own pooling internally, attempting to maintain a pool of Clients will (somewhat counter-intuitively) result in worse performance than using a single one.

