The Automatic Encryption Shared Library (crypt_shared) provides the same functionality as mongocryptd, but does not require you to spawn another process to perform automatic encryption. By default, the mongodb crate attempts to load crypt_shared from the system and if found uses it automatically. To load crypt_shared from another location, set the "cryptSharedLibPath" field in extra_options: # extern crate mongodb;
# use mongodb::{bson::doc, Client, error::Result};
#
# async fn func() -> Result<()> {
# let options = todo!();
# let kv_namespace = todo!();
# let kms_providers: Vec<_> = todo!();
let client = Client::encrypted_builder(options, kv_namespace, kms_providers)? .extra_options(doc! { "cryptSharedLibPath": "/path/to/crypt/shared", }) .build();
#
# Ok(())
# } If the mongodb crate cannot load crypt_shared it will attempt to fallback to using mongocryptd by default. Include "cryptSharedRequired": true in the extra_options document to always use crypt_shared and fail if it could not be loaded. For detailed installation instructions see the MongoDB documentation on Automatic Encryption Shared Library .

