If using crypt_shared is not an option, the mongocryptd binary is required for automatic client-side encryption and is included as a component in the MongoDB Enterprise Server package . For detailed installation instructions see the MongoDB documentation on mongocryptd . mongocryptd performs the following: Parses the automatic encryption rules specified to the database connection. If the JSON schema contains invalid automatic encryption syntax or any document validation syntax, mongocryptd returns an error. Uses the specified automatic encryption rules to mark fields in read and write operations for encryption. Rejects read/write operations that may return unexpected or incorrect results when applied to an encrypted field. For supported and unsupported operations, see Read/Write Support with Automatic Field Level Encryption . A Client configured with auto encryption will automatically spawn the mongocryptd process from the application's PATH. Applications can control the spawning behavior as part of the automatic encryption options: # extern crate mongodb;
# use mongodb::{bson::doc, Client, error::Result};
#
# async fn func() -> Result<()> {
# let options = todo!();
# let kv_namespace = todo!();
# let kms_providers: Vec<_> = todo!();
let client = Client::encrypted_builder(options, kv_namespace, kms_providers)? .extra_options(doc! { "mongocryptdSpawnPath": "/path/to/mongocryptd", "mongocryptdSpawnArgs": ["--logpath=/path/to/mongocryptd.log", "--logappend"], }) .build();
#
# Ok(())
# } If your application wishes to manage the mongocryptd process manually, it is possible to disable spawning mongocryptd: # extern crate mongodb;
# use mongodb::{bson::doc, Client, error::Result};
#
# async fn func() -> Result<()> {
# let options = todo!();
# let kv_namespace = todo!();
# let kms_providers: Vec<_> = todo!();
let client = Client::encrypted_builder(options, kv_namespace, kms_providers)? .extra_options(doc! { "mongocryptdBypassSpawn": true, "mongocryptdURI": "mongodb://localhost:27020", }) .build();
#
# Ok(())
# } mongocryptd is only responsible for supporting automatic client-side field level encryption and does not itself perform any encryption or decryption.

